import React, { useRef } from 'react';
import classes from './App.module.css';
// import Header from './components/Header';
import Intro from './components/Intro';
import TaskBar from './components/TaskBar';
import AboutMe from './components/AboutMe';
import Experience from './components/Experience';
import ContactMe from './components/ContactMe';
import Projects from './components/Projects';
import RoundCharacter from './Assets/Image1.png';
import { Parallax, ParallaxLayer } from '@react-spring/parallax';

const App = () => {

  const ref = useRef();

  return (
    <div>
      <div style={{ width: '100%', height: '100%', background: 'red' }}>
        <Parallax pages={6} ref={ref} >
          <ParallaxLayer offset={0} speed={0.02} style={{
            backgroundColor:'red'
          }}>
            <div className={classes.Intro}><Intro/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={1} speed={0.2} style={{
            backgroundColor:'yellow'
          }}>
            <div className={classes.ExpericeContainer}><AboutMe/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={2} speed={0.3} style={{
            backgroundColor:'purple'
          }}>
            <div className={classes.ExpericeContainer}><Experience/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={3} speed={0.2} style={{
            backgroundColor:'pink'
          }}>
            <div className={classes.ExpericeContainer} ><Projects/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={4} speed={0.2} style={{
            backgroundColor:'blue'
          }}>
            <div className={classes.ExpericeContainer} ><Experience/></div>
          </ParallaxLayer>

          <ParallaxLayer offset={5} speed={0.2} style={{
            backgroundColor:'green'
          }}>
            <div className={classes.ExpericeContainer}><ContactMe/></div>
          </ParallaxLayer>
        </Parallax>

        <div>
          <TaskBar className={classes.taskBarContainer}/>
        </div>

        {/* <div className={classes.Intro}>
          <Intro />
        </div>

        <div className={classes.aboutMeContainer}>
          <AboutMe/>
        </div>

        <div className={classes.ExpericeContainer}>
          <Experience/>
        </div>

        <div>
          <Projects/>
        </div>

        <div className={classes.ExpericeContainer}>
          <ContactMe/> */}
        {/* </div> */}
      </div>
    </div>
  );
};

export default App;
